import React, { useState, useEffect, useRef } from 'react';
import {
  FaHome,
  FaInbox,
  FaComments,
  FaFileAlt,
  FaChartBar,
  FaClock,
  FaEllipsisH,
  FaGlobe,
  FaEye,
  FaPlus,
  FaSearch
} from 'react-icons/fa';

import './Siderbar.css';

const Sidebar = ({ activeTab, setActiveTab }) => {
  const [menuOpen, setMenuOpen] = useState(false);
  const [showModal, setShowModal] = useState(false);

  const handleMenuOpen = () => {
    setMenuOpen(!menuOpen);
  };

  const handleModalOpen = () => {
    setShowModal(true);
  };

  const handleModalClose = () => {
    setShowModal(false);
  };

  return (
    <div className="sidebar">
      {/* Sidebar navigasyon kısmı */}
      <button
        className={`sidebar-item ${activeTab === 'Home' ? 'active' : ''}`}
        onClick={() => setActiveTab('Home')}
      >
        <FaHome className="icon" /> Home
      </button>
      <button
        className={`sidebar-item ${activeTab === 'Inbox' ? 'active' : ''}`}
        onClick={() => setActiveTab('Inbox')}
      >
        <FaInbox className="icon" /> Inbox
      </button>
      <button
        className={`sidebar-item ${activeTab === 'Chat' ? 'active' : ''}`}
        onClick={() => setActiveTab('Chat')}
      >
        <FaComments className="icon" /> Chat
      </button>
      <button
        className={`sidebar-item ${activeTab === 'Docs' ? 'active' : ''}`}
        onClick={() => setActiveTab('Docs')}
      >
        <FaFileAlt className="icon" /> Docs
      </button>
      <button
        className={`sidebar-item ${activeTab === 'Dashboards' ? 'active' : ''}`}
        onClick={() => setActiveTab('Dashboards')}
      >
        <FaChartBar className="icon" /> Dashboards
      </button>
      <button
        className={`sidebar-item ${activeTab === 'Timesheets' ? 'active' : ''}`}
        onClick={() => setActiveTab('Timesheets')}
      >
        <FaClock className="icon" /> Timesheets
      </button>
      <button
        className={`sidebar-item ${activeTab === 'More' ? 'active' : ''}`}
        onClick={() => setActiveTab('More')}
      >
        <FaEllipsisH className="icon" /> More
      </button>

      {/* Spaces bölüm başlığı ve ikon butonları */}
      <div className="spaces">
        <div className="spaces-header">
          <h3 className="spaces-title">Spaces</h3>
          <div className="icon-button-group">
            <button className="icon-button small-icon-button" title="More options">
              <FaEllipsisH className="icon" />
            </button>
            <button className="icon-button small-icon-button" title="Search">
              <FaSearch className="icon" />
            </button>
            <button
              className="icon-button small-icon-button create-space-button"
              title="Create new space"
              onClick={handleModalOpen}
            >
              <FaPlus className="icon" />
            </button>
          </div>
        </div>

        {/* Spaces içerik */}
        <div className="spaces">
          <button
            className={`space-item ${activeTab === 'Everything' ? 'active' : ''}`}
            onClick={() => setActiveTab('Everything')}
          >
            <FaGlobe className="icon" /> Everything
          </button>
          <button className="space-item">
            <FaEye className="icon" /> View All Spaces
          </button>
          <button className="space-item">
            <FaPlus className="icon" /> Create Space
          </button>
        </div>
      </div>

      {/* Modal ekranı */}
      {showModal && (
        <div className="modal-overlay">
          <div className="modal-content">
            <h2>Create a space</h2>
            <p>A space represents teams, departments, or groups, each with its own Lists, workflows, and settings.</p>
            <form className="space-form">
              <label>
                Icon & Name
                <input type="text" placeholder="e.g. Marketing, Engineering, HR" />
              </label>
              <label>
                Description (optional)
                <textarea placeholder="Description (optional)" />
              </label>
              <div className="form-footer">
                <label>
                  Make Private
                  <input type="checkbox" />
                </label>
                <button className="modal-button">Use Templates</button>
              </div>
            </form>
            <div className="modal-actions">
              <button className="modal-button" onClick={handleModalClose}>
                Cancel
              </button>
              <button className="modal-button-primary">Continue</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default Sidebar;
